(self.webpackChunksite=self.webpackChunksite||[]).push([[1373],{4084:function(t){"use strict";t.exports=JSON.parse('{"slug":"earth-invaders","title":"Earth Invaders","author":"Yara F. Scramin","github":"yarafs","date":1753488000000,"readme":"<p>Inspired by the classic <em>Space Invaders</em>, except this time, Earth is the enemy. Destroy incoming ships, dodge bullets, and use your ultimate ability to obliterate everything.</p>\\n<p>Fast reflexes and smart timing are your best weapons. <strong>Good luck, defender!</strong></p>\\n<h2>How to Play</h2>\\n<ul>\\n<li>If an enemy bullet hits you, you <strong>lose</strong> a life.</li>\\n<li>If an enemy reaches the bottom of the screen, you <strong>lose</strong> a life.</li>\\n<li>You have <strong>3 lives</strong>. Lose all of them, and it\'s <strong>game over</strong>.</li>\\n<li>Defeating an enemy increases your score by 1.</li>\\n<li>Difficulty increases as you survive, up to a max at score 100.</li>\\n</ul>\\n<h2>Controls</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Button</th>\\n<th align=\\"center\\">Action</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>Arrow Keys</td>\\n<td align=\\"center\\">Move Spaceship</td>\\n</tr>\\n<tr>\\n<td>X</td>\\n<td align=\\"center\\">Shoot</td>\\n</tr>\\n<tr>\\n<td>Z</td>\\n<td align=\\"center\\">Ultimate</td>\\n</tr>\\n</tbody>\\n</table>"}')}}]);